import Banner from '../components/Banner'
import CharteList from '../components/CharteList'
import PresentationAbout from '../components/PresentationAbout'

function About() {
    return (
        <div>
            <Banner />
            <PresentationAbout />
            <CharteList />
        </div>
    )
}

export default About
